import React from 'react'
import LatestStories from '../LatestStories/LatestStories'
import Latestheading from '../Latestheading/Latestheading';
import stories from './stories.css';
import { NavLink } from 'react-router-dom';
import { useState } from 'react';
import { useEffect } from 'react';
import axios from 'axios';
function Stories() {
  const [stories,setstories]=useState([]);
  useEffect(()=>{
    const getdata=async()=>{
      const res=axios.get("http://localhost:5000/api/stories")
      setstories(res.data);
    }
    getdata()
  },[])
  return (
    <div className='stories'>
      <Latestheading data={{ name1: "Latest", name2: "Stories" }} />
      <div className='hr1'></div>
      <div className='stories-alll'>
        <NavLink to="/test/22" className="Nav">
          <LatestStories data="Tech" />
          <LatestStories data="Style" />
          <LatestStories data="Tech" />
        </NavLink>
        </div>
      </div>


  )
}

export default Stories
